tart_time":"2024-09-02T03:28:16.82741","status":"completed"},"tags":[]},"source":["Bellabeat representa más que una marca; Es un testimonio del empoderamiento de las mujeres a través de la tecnología. Para mí, se trata de crear un futuro en el que el bienestar se integre a la perfección en todos los aspectos de nuestras vidas."]},{"cell_type":"markdown","id":"c0fa175e","metadata":{"papermill":{"duration":0.014695,"end_time":"2024-09-02T03:28:16.874341","exception":false,"start_time":"2024-09-02T03:28:16.859646","status":"completed"},"tags":[]},"source":["Somos una marca, a la vanguardia de la tecnología dedicada activamente a la salud y multipremiada.\n","\n","\n","\n","# 1 – Tarea Empresarial:\n","\n","Concentrarnos en uno de los productos de Bellabeat y analizar los datos de los dispositivos inteligentes para conocer el uso que hacen los consumidores de sus dispositivos inteligentes. Saber cómo usan los consumidores los dispositivos inteligentes que no son de Bellabeat, para nos recomendó usar entre una de las fuentes datos de una investigación realizada por Fitbit.\n","\n","<https://www.kaggle.com/arashnic/fitbit>\n","\n","# Metadatos:\n","\n","Este conjunto de datos fue generado personas que respondieron a través de encuesta distribuida por Amazon Mechanical Turk. Fecha: entre el 03.12.2016 y el 05.12.2016. Muestreo: Treinta usuarios elegibles de Fitbit dieron su consentimiento para el envío de datos de seguimiento personal. Datos: a nivel de minuto para la actividad física, la frecuencia cardíaca y el monitoreo del sueño. Los informes individuales se pueden analizar por ID de sesión de exportación (columna A) o marca de tiempo (columna B). La variación entre los resultados representa el uso de diferentes tipos de monitores Fitbit y los comportamientos/preferencias de seguimiento individuales.\n"]},{"cell_type":"markdown","id":"d835aa46","metadata":{"papermill":{"duration":0.01466,"end_time":"2024-09-02T03:28:16.904319","exception":false,"start_time":"2024-09-02T03:28:16.889659","status":"completed"},"tags":[]},"source":["# Limitaciones de nuestro dataset: \n","Solo se observa a 30 personas, desconocemos las edades, el sexo y la ubicación geográfica, la ventana de observación son solo 2 meses. Los datos Si son Confiables y Originales, No son Integrales, No son actuales.\n","\n","\n","\n","# Inicio del trabajo:\n","\n","Gracias a Mobius por compartir los dataframes:\n","\n"]},{"cell_type":"code","execution_count":2,"id":"b2aa4b87","metadata":{"execution":{"iopub.execute_input":"2024-09-02T03:28:16.97268Z","iopub.status.busy":"2024-09-02T03:28:16.936901Z","iopub.status.idle":"2024-09-02T03:28:37.561334Z","shell.execute_reply":"2024-09-02T03:28:37.559345Z"},"papermill":{"duration":20.64497,"end_time":"2024-09-02T03:28:37.564724","exception":false,"start_time":"2024-09-02T03:28:16.919754","status":"completed"},"tags":[]},"outputs":[],"source":["caminata_minutos <- read.csv(\"/kaggle/input/fitbit/mturkfitbit_export_4.12.16-5.12.16/Fitabase Data 4.12.16-5.12.16/minuteStepsNarrow_merged.csv\")\n","sueno_minutos <- read.csv(\"/kaggle/input/fitbit/mturkfitbit_export_4.12.16-5.12.16/Fitabase Data 4.12.16-5.12.16/minuteSleep_merged.csv\")\n","metabolica_minutos <- read.csv(\"/kaggle/input/fitbit/mturkfitbit_export_4.12.16-5.12.16/Fitabase Data 4.12.16-5.12.16/minuteMETsNarrow_merged.csv\")\n","intensidad_minutos <- read.csv(\"/kaggle/input/fitbit/mturkfitbit_export_4.12.16-5.12.16/Fitabase Data 4.12.16-5.12.16/minuteIntensitiesNarrow_merged.csv\")\n","calorias_minuto <- read.csv(\"/kaggle/input/fitbit/mturkfitbit_export_4.12.16-5.12.16/Fitabase Data 4.12.16-5.12.16/minuteCaloriesNarrow_merged.csv\")\n","frecuencia_cardiaca <- read.csv(\"/kaggle/input/fitbit/mturkfitbit_export_4.12.16-5.12.16/Fitabase Data 4.12.16-5.12.16/heartrate_seconds_merged.csv\")\n","calorias_minuto <- read.csv(\"/kaggle/input/fitbit/mturkfitbit_export_4.12.16-5.12.16/Fitabase Data 4.12.16-5.12.16/minuteCaloriesNarrow_merged.csv\")"]},{"cell_type":"markdown","i